export default{
    SET_NEWS(state, news) {
        state.news = news;
    },
    SET_ASK(state, ask_items) {
        state.ask_items = ask_items;
    },
    SET_JOBS(state, jobs) {
        state.jobs = jobs;
    },
    SET_USER(state, user){
        state.user = user;
    }
}
